import React from "react";

const Footer = () => {
  return (
    <div className="md:h-[40vh] lg:h-[55vh] h-[30%] mt-20 w-[100%] bg-[#E1611F] text-white m-4 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
      <div className="p-4">
        <p className="font-extrabold text-center text-4xl">Flavz</p>
        <p className="font-normal text-sm text-left">
          Welcome to <span className="text-orange-700">FlavZ</span> the ultimate destination for culinary enthusiasts and home cooks!
        </p>
      </div>
      <div className="p-4">
        <p className="font-normal text-base">Support</p>
        <p>Payment</p>
        <p>Terms of services</p>
        <p>Privacy policy</p>
        <p>About Us</p>
      </div>
      {/* Add content to the other two grid sections if needed */}
      {/* <div className="p-4">...</div> */}
      {/* <div className="p-4">...</div> */}
    </div>
  );
};

export default Footer;
